Drama
108 minuten
goed

met Kevin Bacon, Colin Firth en Alison Lohman

Journaliste Karen O'Connor onderzoekt de waarheid achter het uit elkaar gaan van een beroemd komisch duo, jaren geleden. De twee 
komieken, Vince Collins en Lanny Morris, vonden destijds een jong meisje overleden in hun hotelkamer, waarna ze besloten te 
stoppen. Ondanks dat ze beiden een waterdicht alibi hadden en ze niet werden beschuldigd, bleek dit het einde van het duo.
